import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  width: 30%;
  height: 50%;
  background-color: #e9ecef;
  border-radius: 20px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  padding: 0 80px;
`;

const TitleContainer = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  margin-top: 40px;
  margin-bottom: 10px;
`;

const Title = styled.div`
  font-weight: 600;
  font-size: 27px;
  color: #212529;
`;

const Form = styled.form`
  width: 100%;
  height: 80%;
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-top: 30px;
`;

const LoginForm = () => {
  return (
    <Container>
      <TitleContainer>
        <Title>Login</Title>
      </TitleContainer>
      <Form>
        
      </Form>
    </Container>
  )
};

export default LoginForm;
